import "./App.css";
import React from "react";
import {
  Switch,
  BrowserRouter as Router,
  Route,
  Redirect,
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Redirect to="/desktop-dashboard" />
        </Route>
      </Switch>
    </Router>
  );
}
